public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  NodeLabelInfo other = (NodeLabelInfo) obj;
  if (!getName().equals(other.getName())) {
    return false;
  }
  if (getExclusivity() != other.getExclusivity()) {
    return false;
  }
  return true;
}
